import styles from './Filter.module.css'
import {
  selectAuthorFilter,
  selectDatafilter,
  selectStatusFilter,
  selectTypeFilter,
} from '../State/filterSlice'
import { setTypeFilter } from '../State/filterSlice'
import { useDispatch, useSelector } from 'react-redux'

function Filter() {
  const typeFilter = useSelector(selectTypeFilter)
  const dispatch = useDispatch()

  const handleTypeFilter = (event) => {
    dispatch(setTypeFilter(event.target.value))
    console.log(event.target.value)
  }

  return (
    <div className={styles.container}>
      {/*1  */}
      <div className={styles.author_filter__container}>
        <input type="text" placeholder="Фильтр по автору" />
      </div>
      {/*2  */}
      <div className={styles.author_filter__container}>
        <input type="text" placeholder="Фильтр по дате" />
      </div>
      {/* 3 */}
      <div className={styles.type_filter__container}>
        <div className={styles.type_filter__content_container}>
          <label>
            <input
              type="radio"
              value={'Ошибка'}
              checked={typeFilter === 'Ошибка' ? true : false}
              onChange={(event) => handleTypeFilter(event)}
            />
            Ошибка
          </label>
          <label>
            <input
              type="radio"
              value={'Новая функциональность'}
              checked={typeFilter === 'Новая функциональность' ? true : false}
              onChange={(event) => handleTypeFilter(event)}
            />
            Новая функциональность
          </label>
        </div>
        <div className={styles.type_filter__content_container}>
          <label>
            <input
              type="radio"
              value={'Улучшение'}
              checked={typeFilter === 'Улучшение' ? true : false}
              onChange={(event) => handleTypeFilter(event)}
            />
            Улучшение
          </label>
          <label>
            <input
              type="radio"
              value={'Документация'}
              checked={typeFilter === 'Документация' ? true : false}
              onChange={(event) => handleTypeFilter(event)}
            />
            Документация
          </label>
        </div>
      </div>
      {/* 4 */}
      <div className={styles.type_filter__content_container}>
        <label>
          <input
            type="radio"
            value={'Улучшение'}
            checked={typeFilter === 'Улучшение' ? true : false}
            onChange={(event) => handleTypeFilter(event)}
          />
          Улучшение
        </label>
        <label>
          <input
            type="radio"
            value={'Документация'}
            checked={typeFilter === 'Документация' ? true : false}
            onChange={(event) => handleTypeFilter(event)}
          />
          Документация
        </label>
      </div>
    </div>
  )
}

export default Filter
